import React from 'react'

class Index extends React.Component{
    constructor(){
        super();
        this.state = {
            loginForm: false,
            signinForm: false
        }
    }

    render(){
        return( 
            <>
            <button className="loginButton" onClick={()=>this.setState({loginForm: !this.state.loginForm})}>
            {this.state.loginForm? "hi": "form"}
            </button>
            </>
        );
    }
}

export default Index;
